INSERT INTO `faq` (`id`, `serial`, `title`, `for_whom`, `details`, `student_id`, `name`, `active`, `date`) VALUES (1,1,'How to update informations?','all','<p>After Login &gt;&gt;&nbsp; Click <strong>Top Left Side Circle Image</strong> of your homepage&nbsp; &gt;&gt;&nbsp; On this section you will see 4 options, you have to <strong>Click 2nd option to update informations&nbsp; </strong>&gt;&gt;&nbsp; then <strong>edit</strong> what you want.<br></p>','1510233221','Saklayen Ahmed',1,'19/07/2020 08:12:31pm'),(2,2,'How to change profile photo?','all','<p>After Login &gt;&gt;&nbsp; Click <strong>Top Left Side Circle Image</strong> of your homepage&nbsp; &gt;&gt;&nbsp; On this section you will see 4 options, you have to <strong>Click 3rd option to change Profile Photo </strong>&gt;&gt;&nbsp; then <strong>change </strong>and confirm.<br></p>','1510233221','Saklayen Ahmed',1,'19/07/2020 08:12:21pm'),(3,3,'How to change password after login?','all','<p>After Login >>  Click <strong>Top Left Side Circle Image</strong> of your homepage  >>  On this section you will see 4 options, you have to <strong>Click 4th option to change password  </strong>>>  then <strong>fill up three required input fields and confirm.</strong><br></p>','1510233221','Saklayen Ahmed',1,'20/07/2020 11:52:24am'),(4,4,'How to switch your profile on private or public mode?','all','<p>After Login &gt;&gt;&nbsp; On <strong>Top Left Side</strong> find the <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 123, 33);\">Public</span></font> Button &gt;&gt; Click on this button and your profile switched to private mode and showing <font color=\"#FFFFFF\"><span style=\"background-color: rgb(156, 0, 0);\">Private</span></font> word.<br></p><p>For again to switch on <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 123, 33);\">Public</span></font> mode please click on this <font color=\"#FFFFFF\"><span style=\"background-color: rgb(156, 0, 0);\">Private</span></font> Button. then you profile switched to on Public mode again.<br></p>','1510233221','Saklayen Ahmed',1,'19/07/2020 08:23:41pm'),(5,5,'How to add Batch Friends?','onlyadmin','<p>After login >> Find the <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 132, 198);\">Add New button</span></font> >> Click on this button and select <b>Add Batch Friends </b>>> Fill up what required fields showing >> Click <b>Send Request</b><br></p>After click <b>Send Request</b> one mail with <b>Add info URL</b>  and instructions on how to use this link will send to your desired <b>batch friend</b>.<br>','1510233221','Saklayen Ahmed',1,'19/07/2020 08:29:55pm'),(6,6,'How to send Add Info Request again?','onlyadmin','<p>Go to<b> Menu</b> &gt;&gt; Click <b>More</b> &gt;&gt; Click <b>Inactive Info</b> <br></p><p>Then you will see all pending request. you can edit your friends Student ID and email if you have entered wrong data previously. <br></p><p><span style=\"background-color: rgb(255, 214, 99);\">Yellow</span> Button for Edit, <font color=\"#FFFFFF\"><span style=\"background-color: rgb(206, 0, 0);\">Red</span></font> Button for Delete, And <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 123, 33);\">Green</span></font> Button for Send Request Again.<br></p>','1510233221','Saklayen Ahmed',1,'19/07/2020 08:37:50pm'),(7,5,'How to reset password without login?','all','<p>Goto Login Page &gt;&gt; Click <b>Forgot Password?</b>&nbsp; &gt;&gt;&nbsp; Select <b>Batch </b>and enter <b>Email Address</b>&nbsp; &gt;&gt;&nbsp; Click <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 123, 33);\">Send Request</span></font> Button. Then you will get an email with password reset link and some instructions&nbsp; &gt;&gt;&nbsp; Then Click that link to<b> create new password.</b><br></p>','1510233221','Saklayen Ahmed',1,'19/07/2020 09:48:06pm'),(8,7,'How to logout from AIS FAMILY DATABASE?','all','<p>Click Top <strong>Left Circle Image</strong>&nbsp; &gt;&gt;&nbsp; The bottom of this section you will see 4 Options&nbsp; &gt;&gt;&nbsp; After that to <strong>logout or signout</strong> click on the <strong>first option</strong>. It will get out of your database profile.<br></p>','1510233221','Saklayen Ahmed',1,'20/07/2020 12:13:26am'),(9,9,'How generate new add info link?','onlyadmin','<p>Go to<strong> Menu</strong> &gt;&gt; Click <strong>More</strong> &gt;&gt; Click <strong>Inactive Info &gt;&gt;</strong><br></p><p>You will see 4 different color button as action for you only. You have to click on<span style=\"background-color: rgb(57, 132, 198);\"> <font color=\"#FFFFFF\">Blue Button</font></span><font color=\"#FFFFFF\"> </font>to generate new add info link.<br></p><p><b>About others button:</b><br></p><p><span style=\"background-color: rgb(255, 255, 0);\"><b>Yellow </b>Button </span>for <em><b>Edit</b></em>, <font color=\"#FFFFFF\"><span style=\"background-color: rgb(255, 0, 0);\">Red Button</span></font> for <em><strong>Delete</strong></em>, And <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 123, 33);\">Green Button</span></font> for <em><strong>Send Request Again</strong></em>, and <font color=\"#FFFFFF\"><span style=\"background-color: rgb(57, 132, 198);\">Blue Button</span></font> for <strong><em>Generate new add info link</em></strong>.<br></p>','1510233221','Saklayen Ahmed',1,'21/07/2020 01:42:43pm'),(10,10,'How to report any issue to developer?','all','<p>Go to<strong>&nbsp;Menu</strong>&nbsp;&gt;&gt; Click&nbsp;<strong>More</strong>&nbsp;&gt;&gt; Click <strong>Report</strong></p><p>After go to <strong>Report page</strong> you will see a message box. You can send any message against any issue in AIS FAMILY DATABASE.&nbsp;</p><p>Within hours your batch admin&nbsp;try to take necessary steps against your issues.</p>','1510233221','Saklayen Ahmed',1,'21/09/2020 04:06:20pm'),(11,11,'Whats the meaning of Public & Private Mode?','all','<p><font color=\"#397B21\"><strong>What is Public Mode?</strong></font><br></p><ul><li>Anyone* can view your information after login (with valid Student ID and Password).</li></ul><p><strong>*Anyone meaning:</strong></p><ul><li>Your batch-mate.</li><li>All other students who have completed registration in the AIS Family Database.<br></li><li>Obviously, They must be a students of the Department of AIS.</li><li>No one outside of the department can enter here.</li></ul><p><br></p><p><font color=\"#CE0000\"><strong>What is Private mode? </strong></font><br></p><ul><li>Only your batch-mate view your informations.</li><li>All other batches who have completed registration in the AIS Family Database are not able to view your information.</li><li>Your information will not be visible in search results or any where in this Database.<br></li></ul>','1510233221','Saklayen Ahmed',1,'24/07/2020 09:48:59pm'),(12,1,'How to find any information from database?','all','<p><strong>If you want to search with names:</strong><br>To find it very easily, please do not use any short form of words. such as the short form<strong> \"Md, Most\"</strong>. Everyone uses&nbsp; it as their name prefix. Avoid it and try searching with the rest part of their names or any unique words.</p><p>And please look at the small search box to filter your data further after showing search results.</p><p><strong>Do not try:</strong><br>Batch, name, student ID, mobile or any valid item will not display accurate information if you search with all of them. Try searching with any one item whatever you want.</p><p style=\"text-align: left;\"><b style=\"\"><font color=\"#630000\">If you do not remember the spelling of the word you will use to search, please try searching with part of that word. Hope you find your search results.<br></font></b></p><p><strong>All batch list data view and filtering:</strong><br>Also view information of your batch from \"My Batch\" or click \"Other Batch &gt;&gt; Select Batch\" to view information of other batches. If you view information of any batch, look at the small search box to filter your data further.</p><p>I hope you will find your desired person.</p>','1510233221','Saklayen Ahmed',1,'24/09/2020 03:33:02pm');
/*!40000 ALTER TABLE `faq` ENABLE KEYS */;
UNLOCK TABLES;

