INSERT INTO `iconic19` (`id`, `student_id`, `LastUpdateTime`, `father_phone`, `prefer`, `details`) VALUES (5,'1510433105','24-07-2020 12:30:23pm','01728947608','বাস','<p><strong>বাস:&nbsp;</strong>&nbsp;প্রথমে চাঁপাই নবাবগঞ্জের দিকে একটি বাসে যেতে হবে। বিন্দুর মোড় বা সিটি বাইপাস থেকে বাসে উঠতে হবে । দুটি বাস সার্ভিস আছে। এক \'গৌড় স্পেশাল\' এটি সরাসরি আমার বাড়িতে নিয়ে যাবে। বাসের সুপারভাইজারকে বলতে হবে গ্রামীণ ব্যাংক, রানীহাটি নামিয়ে দিতে । সেখানে পৌঁছানোর পরে কেবল আমার নাম বা আমার বাবার নাম জিজ্ঞাসা করলে , তারা বাড়িতে নিয়ে যাবে। আরেকটি বাস সার্ভিস হল \'মহানন্দা/গেট লক\'। এই বাসগুলি প্রথমে চাঁপাই নবাবগঞ্জ শহরে নিয়ে যাবে। তাই নামতে হবে বিশ্বরোড । এবং গ্রামীণ ব্যাংক, রাণীহাটির জন্য একটি অটো রিকশা নিতে হবে। এবং বাকি টুকু একই।<br><br><strong>ট্রেন:&nbsp;</strong>&nbsp;চাঁপাই নবাবগঞ্জের যে কোন একটি ট্রেনে উঠতে হবে । সেখানে আসার পর গ্রামীণ ব্যাংক, রাণীহাটির জন্য একটি অটো রিকশা নিয়ে রানীহাটি আসতে হবে।&nbsp;<br></p><p><br></p><p><strong>(বিঃদ্রঃ আমার গ্রামের নাম চাক ঘোরা পাখিয়া)</strong></p>'),(8,'1512133109','15-09-2020 02:26:08am','01911733803','বাস','<p>ভদ্রা বাস কাউন্টার থেকে জনী/আর এম বা বি আর টি সি বাস কাউন্টার থেকে টিকেট সংগ্রহ করতে হবে \"অথবা\" (ট্রেন বা বাস দিয়ে যশোর, তারপর সাতক্ষীরা কালিগঞ্জ এর বাস দিয়ে খুলনা রোড) নামতে হবে খুলনা রোড এ ।</p>'),(10,'1510733111','','01731226616','','<p>রাজশাহী থেকে ঢাকা ট্রেন বা বাস দিয়ে কমলাপুর রেলস্টেশন । তারপর যেতে হবে সদরঘাট লঞ্চ টার্মিনাল । সন্ধ্যা ৫টা-৬টার দিকে লঞ্চে উঠতে হবে । &quot;তাসরিফ ৩&quot; কিংবা &quot;তাসরিফ ৪&quot; সিঙ্গেল কেবিন ১০০০ টাকা, ডাবল কেবিন ১৬০০ টাকা কিংবা ডেকে ২০০ টাকা ভাড়া । হাতিয়ায় সকাল ৯ট -১০ টার দিকে নামাবে । তারপর সিএনজি দিয়ে সাগরীয়া বাজার ভাড়া ১০০ টাকা, কিংবা বাইক এর ভাড়া ২০০ টাকা করে । সাগরীয়া বাজারে যেয়ে তোহা মাস্টার বা বকুল মেম্বার এর বাড়ি বললেই যে কেউ চিনিয়ে দিবে আমার বাড়ী ।</p>\r\n'),(11,'1510533112','','01740965146','ট্রেন','<p><strong>ট্রেনঃ&nbsp;</strong>ভ্রমনের জন্য ট্রেন আমার প্রথম পছন্দ । রাজশাহী থেকে সাগরদাঁড়ি ট্রেন দিয়ে যশোর নামতে হবে । তারপর লোকাল বাস দিয়ে নড়াইল যেতে হবে । তারপর যশোর থেকে লোকাল বাসে করে নড়াইল মুচিরপোল বাসস্ট্যান্ডে নামতে হবে। সেখান থেকে ইজি বাইকে করে নড়াইল জজকোর্টে যেতে হবে, জজকোর্টের পাশেই আমার বাসা।<br /><br /><strong>বাসঃ</strong>&nbsp;বিআরটিসি, এমকে পরিবহন সরাসরি নড়াইল যায়। এছাড়া জনি, মেট্রোপলিটন বাসে যশোর পর্যন্ত যায়, যশোর থেকে লোকাল বাসে করে নড়াইল মুচিরপোল বাসস্ট্যান্ডে নামতে হবে। সেখান থেকে ইজি বাইকে করে নড়াইল জজকোর্টে যেতে হবে, জজকোর্টের পাশেই আমার বাসা।</p>'),(13,'1510633114','','01878047032','ট্রেন','<p>প্রথমে রাজশাহী রেলওয়ে স্টেশন থেকে ঢাকা এর টিকেট নিতে হবে । টিকেট মূল্য ৩৪০ টাকা ,নামতে হবে এয়ারপোর্ট । এয়ারপোর্ট থেকে খিলক্ষেত , পরে খিলক্ষেত থেকে বরুয়া যেতে হবে , পরে রিকশা দিয়ে আমার বাড়ি ।</p>\r\n'),(19,'1512233120','','01962695372','ট্রেন','<p>রাজশাহী থেকে সাগরদাঁড়ি ট্রেন দিয়ে যশোর স্টেশন পর্যন্ত যেতে হবে । তারপর স্টেশন থেকে রিকশা দিয়ে চুয়াডাঙ্গা বাসস্ট্যান্ড, কাঁচা বাজার এ যেতে হবে, রিকশা ভাড়া নিবে ৩০ টাকা, রিকশা থেকে নেমে কাঁচা বাজারে গিয়ে &quot;রহিম বাগ&quot; নামে বড় একটা গেট আছে , ওই গেট দিয়ে ভিতরে ঢুকে একেবারে শেষ মাথায় অর্থাৎ ১৫ নং বাসার নিচতলায় আমরা থাকি ।</p>'),(21,'1510533122','','01822637907','বাস','<p><strong>একঃ&nbsp;</strong>রাজশাহী থেকে ঢাকার ট্রেন (৩৪০/-)। তারপর কমলাপুর নেমে দুই ভাবে যাওয়া যাবে ফুটওভার পার হয়ে যাত্রাবাড়ি বাস (১০/-) কিংবা রিশকা দিয়ে যাত্রাবাড়ি (৫০/-)।&nbsp;<strong>একঃ</strong>&nbsp;যাত্রাবাড়ি থেকে ফারমের মোড় এর লেগুনা (১৫/-) তারপর সেখান থেকে কেরানীপারা রিসকা (১০/-)বা হেটে ঠিকানা কেরানীপারা স্কুল রোড ১১ নং বাড়ি ওয়ার্ড নং ০৭<br />\r\n<br />\r\n<strong>দুইঃ</strong>&nbsp;যাত্রাবাড়ি থেকে মাতুয়াইল মেডিকেল (১০/-) সেখান থেকে ফারমের মোড় (১০/-) তারপর সেখান থেকে কেরানীপারা রিসকা (১০/-)বা হেটে ঠিকানা কেরানীপারা স্কুল রোড ১১ নং বাড়ি ওয়ার্ড নং ০৭</p>\r\n'),(24,'1510833125','',' 0171472291','বাস','<p>রাজশাহী থেকে বরিশাল যাওয়ার বাসে করে ভাঙা নামতে হবে । ভাড়া ৫০০-৬০০ টাকা। ভাঙা নেমে গোপালগঞ্জ এর বাস এ উঠতে হবে। নামতে হবে শরীফ পাড়া। ভাড়া ৩০-৪০ টাকা পড়বে। শরিফ পাড়া নেমে ফলসী/তালবাড়ি যাওয়ার জন্য ভ্যান ভাড়া করতে হবে। ভাড়া ১০-১৫ টাকা করে পড়বে। তালবাড়ি নেমে যে কাউকে আমার বাবার নাম বা চাচার নাম (মহর মোল্লা) বললে বাড়ি চেনায় দিবে।</p>'),(25,'1510433126','','01943231765','বাস','<p>রাজশাহী থেকে বাস ট্রেন দুই ভাবে ই আসা যায়। বাস এ যাওয়া সহজ -</p><p>&nbsp;</p><p><strong>বাসঃ </strong>রাজশাহী থেকে ঢাকা লাইনের যে কোন বাসে উঠে চন্দ্রা নামতে হবে। তারপর রিক্সা / অটো করে চন্দ্রা পল্লিবিদ্যুৎ নেমে রিক্সা নিয়ে এপেক্স ফারিস্ট এর গেট এ নামলে ই আমাদের বাসা।</p>'),(44,'1510833145','','01937744843','ট্রেন','<p>রাজশাহী থেকে যশোর ট্রেনে যেতে হবে ভাড়া- ২৬০ টাকা । যশোর স্টেশন থেকে চাসরা বাস স্ট্যান্ড যেতে হবে । তারপর বাস দিয়ে ঝিকরগাছা -ভাড়া-২০ টাকা । বাস যে দিকে থামবে তার বাম দিকে ২-৩ মিনিট হাটলেই আমার বাসা ।</p>\r\n'),(48,'1512133149','','01714495954','ট্রেন','<p>ট্রেনে যেতে হলে, রাজশাহী থেকে শহীদ মনসুর আলী স্টেশন এ নামতে হবে ,ভাড়া-১৫০ টাকা । পরে রেল গেট থেকে সি এন জি নিইয়ে সিরাজগঞ্জ সদর ভদ্রাগেট নামতে হবে । তারপর ভদ্রাগেট থেকে ভ্যান কিংবা সি এন জি তে করে আমার গ্রাম কৃষ্ণদিয়া -মিয়া পাড়ায় যেতে হবে ।</p>'),(54,'1510433156','02-04-2020 14:27:46pm','01716739769','বাস অথবা ট্রেন','<ul><li>ঢাকা থেকে ডিরেক্ট চট্টগ্রামের উঠে মিরসরাই থানার সামনে নামতে হবে, থানার সামনে বরাবর ১টাই রাস্তা আছে, সেটা দিয়ে সোজা যাইতে থাকলেই সবার শেষের ৫ তলা বাড়ির ২য় তলায় আমরা থাকি।</li><li>ঢাকা থেকে চট্টগ্রামের লোকাল বাসেও যাওয়া যায়</li><li>ঢাকা টু ফেনীর ডিরেক্ট বাসে উঠলে ফেনী মহিপাল নামতে হবে, তারপরে চট্টগ্রামগামী যেকোনো লোকাল বাস ধরে মিরসরাই থানার সামনে নামতে হবে।</li><li>ঢাকা টু ফেনী ট্রেনে (সুবর্ণ, সোনার বাংলা ছাড়া সব ট্রেন) গেলে ফেনী নেমে অটোতে করে মহিপাল আসতে হবে, তারপরে লোকাল বাসে করে মিরসরাই থানার সামনে নামতে হবে।</li></ul>'),(59,'1510633163','15-04-2020 19:34:34pm','01725546404','বাস অথবা ট্রেন','<p><strong>ট্রেন:&nbsp;</strong>রাজশাহী থেকে নীলফামারী পৌঁছানোর জন্য দুটি ট্রেন রয়েছে। তিতুমীর এক্সপ্রেস এবং বরেন্দ্র এক্সপ্রেস। তিতুমীর এক্সপ্রেস সকাল ৬ টা ২০ মিনিটে এবং বরেন্দ্র এক্সপ্রেস বিকাল ৩ টায় ছাড়ে রাজশাহী স্টেশন থেকে । আমার বাড়িতে পৌঁছানোর জন্য আমি তিতুমীর এক্সপ্রেসকে পছন্দ করি। তিতুমীর এক্সপ্রেস প্রায় দুপুর ১ টায় নীলফামারীতে পৌঁছায়। তারপর স্টেশন থেকে যেতে হবে &quot;আনন্দ বাবু পুল&quot; রিক্সা দিয়ে। সেখানে থেকে, একটি অটোরিকশা নিয়ে পাঠান পাড়া, মিরগঞ্জ যেতে হবে । আর পাবলিক ট্রান্সপোর্টের মাধ্যমে যেতে চাইলে , অটো-রিক্সায় করে &quot;টেঙনমারী&quot; যেতে হবে । তারপর কোনো অটো বা ভ্যান দিয়ে &quot;পাঠান পাড়া&quot; তে যেতে হবে। পাঠান পাড়া স্কুল এর সামনেই আমার বাড়ি ।<br /><br /><strong>বাস:&nbsp;</strong>প্রথমে রংপুরের যে কোন বাসে যেতে হবে, যা ভদ্রা বাস স্ট্যান্ড থেকে প্রতি ঘন্টায় পাওয়া যায়। তারপর রংপুর বাস টার্মিনাল থেকে লোকাল বাস এ করে জলঢাকায় নামতে হবে। জলঢাকা বাস স্টেশনে সোনালী ব্যাংকের পাশে অটো স্ট্যান্ড থেকে অটোতে করে &quot;মীরগঞ্জ&quot; যেতে হবে । এখন ভ্যানে করে পাঠান পাড়া যেতে হবে । পাঠান পাড়া স্কুল এর সামনেই আমার বাড়ি ।&nbsp;</p><p>&nbsp;</p><p><strong>যাত্রা নিরাপদ হোক&nbsp;&nbsp;</strong></p>'),(62,'1512133166','','01746258120','বাস অথবা ট্রেন','<p><strong>ট্রেনঃ</strong>&nbsp;প্রথমে রাজশাহী রেলওয়ে স্টেশন থেকে জয়পুরহাট এর টিকেট নিতে হবে । টিকেট মূল্য ১৩০ টাকা , প্রথম কাজ সম্পূর্ণ । পরে জয়পুরহাট নেমে অটো (ভাড়া- ১০ টাকা ), রিকশা (ভাড়া - ২০ টাকা ) অথবা ভ্যান (ভাড়া - ১০ টাকা ) দিয়ে বাস স্ট্যান্ড যেতে হবে , পরে বাস দিয়ে ক্ষেতলাল থানার সামনে নামতে হবে , ভাড়া - ২০ টাকা । থানার পশ্চিম দিকের রাস্তা ধরে সূর্যবান গ্রামে প্রবেশ করতে হবে , গ্রামে প্রবেশ করার পর যে কাউকে আমার বাবার নাম আব্দুর রহিম যার কন্যা রাজশাহী বিশ্ববিদ্যালয়ে পড়াশোনা করে , জিজ্ঞাসা করলেই বলে দিবে আমার বাড়ি ।<br /><br /><strong>বাসঃ</strong>&nbsp;বাসে যেতে হলে প্রথমে মহানগর বাস কাউন্টার থেকে জয়পুরহাট এর টিকেট নিতে হবে ভাড়া- ১৮০ টাকা । নামতে হবে বি আর টি সি মোড় । পরে অটো দিয়ে বাস স্ট্যান্ড যেতে হবে ভাড়া-১০ টাকা। পরে বাস দিয়ে ক্ষেতলাল থানার সামনে নামতে হবে , ভাড়া - ২০ টাকা । থানার পশ্চিম দিকের রাস্তা ধরে সূর্যবান গ্রামে প্রবেশ করতে হবে , গ্রামে প্রবেশ করার পর যে কাউকে আমার বাবার নাম জিজ্ঞেস করলেই বলে দিবে আমার বাড়ি ।</p>'),(72,'1512133177','','01711986481','বাস এবং নৌকা','<p>রাজশাহী রেলগেইট থেকে টিকেট কাটতে হবে। রাজশাহী থেকে কিশোরগঞ্জ ৪৮০ টাকা নেবে। নামতে হবে কিশোরগঞ্জ গাইডাল । কিশোরগঞ্জ গাইডাল আসার পর রিক্সা বা অটো দিয়ে একরামপুর যেতে হবে একরামপুরে গিয়ে সি এন জি দিয়ে চামড়াঘাট যেতে হবে চামড়াঘাট গিয়ে ট্রলারে করে ইটনা নতুন বাজার যেতে হবে । ট্রলার থেকে নেমে পশ্চিম গ্রামে আখড়া হাটি তে সত্য রায়ের বাড়ি বললে যে কেউ নিয়ে যাবে</p>'),(76,'1510733181','06-04-2020 14:53:31pm','01688559237','ট্রেন','<p>কিশোরগঞ্জে আসার জন্য মাত্র দুটি বাস রয়েছে অনন্যা সুপার এবং অনিক ট্রাভেলস। বিনোদপুর / কাজলা / ভদ্রা মোড়ের / বাস স্ট্যান্ড থেকে বাসে যেতে হবে। যাত্রা সময়: ৭.০০ (রাজশাহী থেকে) এবং ৭.৩০ (কিশোরগঞ্জ থেকে) টিকিট মূল্য: ৪৮০/- ঈদ ছাড়া । ঈদের সময় এটির জন্য অতিরিক্ত ২০/-, অর্থাৎ মোট ৫০০ টাকা খরচ পরবে)। বাসটি কিশোরগঞ্জের গাবতলী বাস স্ট্যান্ডে পৌঁছাবে ৩.০০ টা - ৪.৩০ টায় । তারপর একরামপুর মোড় যেতে হবে ইজি বাইক দ্বারা যেখানে ১০/- টাকা খরচ করতে হবে অথবা রিক্সা দিয়ে গেলে ১০ টাকা অথবা ১৫ টাকা খরচ করতে হবে। একরামপুর মোড় থেকে, আপনাকে কড়িয়াইল মোড় যাওয়ার জন্য ইজি বাইকগুলি ধরতে হবে এবং এটির জন্য ১৫ টাকার মতো খরচ হবে ইদ ব্যতীত, ইদে এটি অতিরিক্ত ৫/-টাকা দিতে হবে। কড়িয়াইলের মোড়ে আরও যেতে পারেন রিক্সা দিয়ে যা ৩০-৫০ টাকা খরচ করতে হবে । কড়িয়াইল মোড়ে নামার পরে রিকশাওয়ালকে বলতে হবে কাদির মাস্টারের বাড়ির কাছে নিয়ে যেতে । কাদির মাস্টারের বাড়ির কাছে যেতে খরচ হবে ১০ টাকা । তারপর আপনি আমার নাম কাওকে জিজ্ঞাসা করলে বলে দিবে ।</p><p>&nbsp;</p><p><strong>বিঃ দ্রঃ</strong> স্বাভাবিক ভাবে বাস স্ট্যান্ড থেকে একদিন আগে টিকেট সংগ্রহ করতে হবে কিন্তু ইদে বা কোন ছুটির সময়ে ৫-৭ দিন আগে এটি সংগ্রহ করতে হবে।</p>'),(77,'1510533183','','01785318428','বাস','<p>প্রথমে রাজশাহী ভদ্রা বাস স্ট্যান্ড থেকে রংপুর এর বাস দিয়ে ধাপেরহাট নামতে হবে, ভাড়া- ২২০ টাকা । ধাপেরহাট বাস স্ট্যান্ড থেকে ভ্যানে করে লালদীঘি যেতে হবে , ভাড়া ৫ টাকা । ওই খান থেকে একটু সামনে যেয়ে হাতের ডানে, তারপর সরাসরি ৫ মিনিট হাটতে হবে এবং লাল দীঘি যাওয়ার আগেই আমার বাড়ি ।</p>\r\n'),(84,'1510533190','','01725844189','বাস','<p>ঢাকা থেকে বাস দিয়ে ফেনী, ভাড়া-৮০০ টাকা । তারপর সি এ জি দিয়ে কাজীরহাট নামতে হবে । কাজীর হাট বাজার থেকে হেটে কিংবা রিকশা দিয়ে (ভাড়া-১৫ টাকা ) যাওয়া যায় । যেতে হবে শেনেরখীল ইলিয়াস চেয়ারম্যান এর বাড়ী</p>'),(96,'1510633203','','01718969845','বাস','<p>রাজশাহী থেকে রুয়েট গেট বি আর টি সি বা ভদ্রা বাস স্ট্যান্ড থেকে রংপুর এর বাস ধরে বীরগ্রাম, বগুড়া সেনানিবাস নামতে হবে । ওইখান থেকে সিএনজি ধরে মাজীরা যেতে হবে । মাজীরা যাওয়ার পর সি এন জি বা লেগুনা দিয়ে বি-ব্লক যেতে হবে । তারপর দেখতে হবে মোল্লার দোকান কোথায় । মোল্লার দোকানের গলির রাস্তা দিয়ে সামনে আগাতে হবে । হাট তে হাট তে প্রথমে ডান দিকে পরে বাম দিকে আবার কিছুটা যাওয়ার পর বামে , তারপর আবার ডানে , আবার অল্প কিছুদূর যাওয়ার পর বাম দিকে , তারপর ঐ রাস্তার ডানে ,পরে বামে এবং দেখতে পাবি একটা টিনের গেট আছে । ওইটাই আমার বাড়ী ।</p>\r\n'),(98,'1510833207','','01768280120','বাস','<p>রাজশাহী থেকে ময়মনসিংহ এর বাস । বাসের নাম শামিম পরিবহণ । নামতে হবে মুক্তাগাছা বাসস্ট্যান্ড , তারপর অটো বা ভ্যান দিয়ে সরাসরি আমার গ্রামে।</p>'),(100,'1510633209','',' 0171029273','ট্রেন','<p><strong>ট্রেনঃ</strong>&nbsp;রাজশাহী থেকে মধুমতী ট্রেন দিয়ে পাংশা নামতে হবে । তারপর মইশালা বাজারে যেতে হবে । সেখান থেকে মটর সাইকেল, অটো কিংবা মাহেদ্র ধরে বিশাই সরাইল মোহাম্মদ আলীতে যেতে হবে । তারপর ওইখান থেকে কাউকে জমিদার বাড়ী বা বাবু বাড়ী কথা বললেই দেখিয়ে দিবে ।<br />\r\n<br />\r\n<strong>বাসঃ</strong>&nbsp;বাসে যেতে হলে ভদ্রা থেকে কুষ্টিয়ার বাস ধরে কুষ্টিয়া চরহাস নামতে হবে । তারপর পাংশার বাস এ উঠে মইশালা নামতে হবে । সেখান থেকে মটর সাইকেল, অটো কিংবা মাহেদ্র ধরে বিশাই সরাইল মোহাম্মদ আলীতে যেতে হবে । তারপর ওইখান থেকে কাউকে জমিদার বাড়ী বা বাবু বাড়ী কথা বললেই দেখিয়ে দিবে ।</p>\r\n'),(108,'1510133217','',' 0171461338','অটো ','<p>Uposohor ( উপশহর )</p>'),(111,'1510233221','04-05-2020 13:29:51pm','01715075354','বাস অথবা ট্রেন','<p><strong>ট্রেন:</strong>&nbsp;&nbsp;রাজশাহী থেকে ঢাকা ট্রেন এ গেলে (সিল্কসিটি-পদ্মা-ধুমকেতু) ভাড়া জয়দেবপুর পর্যন্ত ৩১০ টাকা আর ঢাকার টিকেট কাটলে ৩৪০ টাকা । যাইহোক নামতে হবে জয়দেবপুর জাংশন (স্টেশন) এ । স্টেশন থেকে উত্তর দিকে হেঁটে এসে জয়দেবপুর রেল ক্রসিং থেকে সি এন জি (ভাড়া-২০ টাকা), আটো (ভাড়া-১০ টাকা), লেগুনা (ভাড়া- ১০ টাকা ) নামতে হবে গাজীপুর চৌরাস্তা মোড়ে । রাস্তার ওপাড় যেতে হবে। গাজীপুর চৌরাস্তা মোড়ে যে স্তম্ভ আছে , ওইটার উত্তর দিকের রাস্তা ময়মনসিংহ রোড। এই রোড এর লেগুনা স্টেশন থেকে লেগুনা তে (ভাড়া-৩৫ টাকা)। আর বাস স্টেশন থেকে রানিং বাস (বাসের নাম- প্রভাতী বনশ্রী পরিবহন, তাকওয়া সার্ভিস,&nbsp;আলম এশিয়া, ইসলাম পরিবহন) অথবা মাওনা যাবে এমন যেকোনো বাস এ ওঠতে হবে , ভাড়া- ৪০ টাকা এর বেশি না । নামতে হবে মাওনা ফ্লাইওভার এর নিচে । ফ্লাইওভার এর পশ্চিম দিকে মাওনা বাজার রোড এর অটো স্ট্যান্ট থেকে কড়ইতলাগামী অটো তে করে চেয়ারম্যান বাড়ি মোড়ে নামতে হবে । চেয়ারম্যান বাড়ি মোড় থেকে দক্ষিণ দিকে ৪ মিনিট ৩২ সেকেন্ড হাটলেই আমার বাড়ি ✌</p><p>&nbsp;</p><p><strong>বাস:</strong>&nbsp;ঢাকার দিকে ট্রেনে না যেয়ে বাসে যেতে চাইলে, সাভারের আগে চান্দনা চৌরাস্তায় নামতে হবে , ভাড়া-৪৫০ টাকা। পূর্ব দিকে গাজীপুর চৌরাস্তা। যেকোন বাস বা লেগুনা তে ওঠে - গাজীপুর চৌরাস্তা নামতে হবে , ভাড়া - ৩০-৪০ টাকা। রাস্তা পাড় হতে হবে না। গাজীপুর চৌরাস্তা মোড়ে যে স্তম্ভ আছে , ওইটার উত্তর দিকের রাস্তা ময়মনসিংহ রোড। এই রোড এর লেগুনা স্টেশন থেকে লেগুনা তে (ভাড়া-৩৫ টাকা)। আর বাস স্টেশন থেকে রানিং বাস (বাসের নাম- প্রভাতী বনশ্রী পরিবহন, তাকওয়া সার্ভিস, আলম এশিয়া, ইসলাম পরিবহন) অথবা মাওনা যাবে এমন যেকোনো বাস এ ওঠতে হবে , ভাড়া- ৪০ টাকা এর বেশি না। নামতে হবে মাওনা ফ্লাইওভার এর নিচে। ফ্লাইওভার এর পশ্চিম দিকে মাওনা বাজার রোড এর অটো স্ট্যান্ট থেকে কড়ইতলাগামী অটো তে করে চেয়ারম্যান বাড়ি মোড়ে নামতে হবে। চেয়ারম্যান বাড়ি মোড় থেকে দক্ষিণ দিকে ৪ মিনিট ৩২ সেকেন্ড হাটলেই আমার বাড়ি।</p>');
