INSERT INTO `notice` (`id`, `student_id`, `name`, `title`, `batch`, `message`, `image_url`, `active`, `date`) VALUES (6,'Developer','Saklayen','Keep up-to-date','','Please keep your information up-to-date regularly. We need your support.',NULL,1,'29/09/2020 01:33am'),(8,'Developer','Saklayen Ahmed','Any Question?','','Please visit Menu >> More >> FAQs page to get your desired answer.',NULL,1,'29/09/2020 01:31am'),(14,'Developer','Saklayen Ahmed Tanim','Welcome to AIS App','','Welcome to AIS Family Database. On this app you can easily find your desired information to contact with others. Please keep your information up-to-date regularly. We need your support. ',NULL,0,'29/09/2020 01:52am'),(15,'Developer','Saklayen Ahmed Tanim','AIS update available','','Notification system upgrade. Now you can see all notifications.',NULL,0,'29/09/2020 02:42pm'),(21,'Developer','Saklayen Ahmed Tanim','Your Activities','','You can now check all your activities in the AIS database with one click. Please goto Menu >> More >> Activity Log.',NULL,1,'07/10/2020 11:34pm'),(27,'Developer','Saklayen Ahmed','ভুল তথ্য অবহিত করুন','','আপনি যদি AIS Family ডাটাবেসে কোনো ভুল তথ্য লক্ষ্য করেন, অবিলম্বে আপনার ব্যাচ এডমিনকে অবহিত করুন।\r\n\r\nধন্যবাদ\r\nAIS Family Controller',NULL,1,'25/07/2021 09:58pm'),(23,'Developer','Saklayen Ahmed Tanim','সর্বশেষ তথ্য হালনাগাদ করুন','','আপনার প্রোফাইলে নিয়মিত সর্বশেষ তথ্য হালনাগাদ করুন যাতে অন্যরা আপনার সম্পর্কে সঠিক তথ্য পেতে পারে।',NULL,1,'17/06/2021 08:02pm'),(24,'Developer','Saklayen Ahmed Tanim','আপনার জিজ্ঞাসা','','AIS ডাটাবেজ বুঝতে অসুবিধা হলে ভিজিট করুন- Menu 》》More 》》FAQs, জেনে নিন প্রয়োজনীয় অপশন সম্পর্কে।',NULL,1,'03/11/2020 03:17pm'),(25,'Developer','Saklayen Ahmed','AIS অ্যাপ আপডেট','','আপনার অ্যাপটি আপডেট করুন। AIS ডাটাবেজ বুঝতে অসুবিধা হলে ভিজিট করুন- Menu 》》More 》》FAQs, জেনে নিন প্রয়োজনীয় অপশন সম্পর্কে।',NULL,1,'01/12/2020 09:45pm'),(49,'1510233221','Saklayen Ahmed','সর্বশেষ তথ্য হালনাগাদ করুন','19th','আপনার প্রোফাইলে নিয়মিত সর্বশেষ তথ্য হালনাগাদ করুন যাতে অন্যরা আপনার সম্পর্কে সঠিক তথ্য পেতে পারে।',NULL,1,'03/12/2021 07:32pm'),(28,'Developer','Saklayen Ahmed','ভালবাসা দিবসের শুভেচ্ছা','','এই যে বাসন্তী প্রিয়..\r\nহলদে ভালবাসায় আঁচল করে নিও!\r\nকরে নাও আমায় তোমার রজনীগন্ধা..\r\nচলো না প্যারিস রোডে হেঁটে আসি.. বিকেল গড়িয়ে আসুক এক মায়াবী সন্ধ্যা!\r\nকরে নাও না আমায়, তোমার মাথায় লাগানো গাজরা ফুল!\r\nতোমাকে পেতে, হৃদয়ে নিতে মন যে আজও ব্যাকুল!\r\nআজকের মত প্লিজ হয়ে যাও আমার ভালবাসার বে-আইন!\r\nপ্লিজ হয়ে যাও না! আমার ভ্যালেন্টাইন!! \r\n\r\n- এম এ হানিফ',NULL,0,'14/02/2021 12:03am'),(29,'Developer','Saklayen Ahmed','বিশ্ববিদ্যালয়ে ক্লাস শুরু','','সকল বিশ্ববিদ্যালয়গুলোয় ঈদ-উল-ফিতরের ছুটির পর ২৪শে মে থেকে শ্রেণীকক্ষে পাঠদান শুরু হবে এবং এর এক সপ্তাহ আগে অর্থাৎ ১৭ই মে থেকে আবাসিক হলগুলো খুলে দেয়া হবে। \r\n\r\n- মাননীয় শিক্ষামন্ত্রী দীপু মনি',NULL,1,'22/02/2021 03:35pm'),(30,'Developer','Saklayen Ahmed','সব পাবলিক বিশ্ববিদ্যালয়ের পরীক্ষা অনলাইনে','','দেশের সব পাবলিক বিশ্ববিদ্যালয়ের অভ্যন্তরীণ পরীক্ষাগুলো অনলাইনে নেওয়া যাবে বলে সিদ্ধান্ত দিয়েছে বিশ্ববিদ্যালয় মঞ্জুরি কমিশন।\r\n\r\n<a href=\"https://m.somoynews.tv/pages/details/277318\" > Click here to view</a>',NULL,0,'06/05/2021 06:56pm'),(33,'Developer','Saklayen Ahmed','Eid Mubarak','','May this Eid bring joy and love to your heart and create all the opportunities of success for you! Eid Mubarak. \r\n\r\nSaklayen Ahmed\r\nAdmin & Controller\r\nAIS Family Database',NULL,0,'13/05/2021 10:03am'),(34,'Developer','Saklayen Ahmed','AIS অ্যাপ এবং মূল URL প্রসঙ্গে','','অনিবার্য কারণবশত আগামী ১৫ দিন AIS অ্যাপ এবং aisru.cf, aisfamily.cf  বন্ধ থাকবে। প্রয়োজনে নিচের Link গুলো ব্যবহার করুন-\r\n- aa22ru.cf\r\n- tudomais23rd.cf\r\n- tremendous20th.cf',NULL,1,'14/07/2021 10:30pm'),(35,'Developer','Saklayen Ahmed','AIS Family App - Update','','Please update AIS app ASAP. \r\nFor update, \r\n》》Open AIS app \r\n》》Wait a few moments, Automatically will be shown update window. Or Click Left Bottom grid button to check for new update.\r\n》》Click Update Button.',NULL,1,'26/07/2021 05:54pm'),(45,'Developer','Saklayen Ahmed','More than one URL for AIS Database','','These are the access URL for AIS Family Database - \r\n\r\n1. ais-family.cf\r\n2. aisfamily.ml\r\n3. ais-ru.cf\r\n4. aisru.ml\r\n5. ruais.cf\r\n6. ruais.ml\r\n7. aisfamilyru.cf\r\n8. aisfamily.cf\r\n\r\nPlease visit the AIS Family Database with above mentioned any URL.\r\n\r\nThanks.',NULL,1,'24/08/2021 02:51pm'),(46,'Developer','Saklayen Ahmed','Tips: How to search a person ?','','If you want to search with names:\r\n\r\nTo find it very easily, please do not use any short form of names. such as the short form \"Md, Most\". Everyone uses it as their name prefix. Avoid it and try searching with the rest part of their names or any unique words.',NULL,1,'11/10/2021 11:32pm'),(47,'1510233221','Saklayen Ahmed','Regular Update','19th','Please update your personal details on regular basis.',NULL,1,'03/09/2021 11:28pm'),(48,'Developer','Saklayen Ahmed','Tips: How to search a person ?','','If you do not remember the spelling of the word that you will use to search, please try searching with part of that word (Name, ID, Address, Email). Hope you find your search results.',NULL,1,'30/10/2021 03:46pm'),(50,'1510233221','Saklayen Ahmed','রক্তের গ্রুপ সহজেই খুঁজুন','19th','রক্তের গ্রুপ দিয়ে খোঁজার জন্য শুধুমাত্র O+ লিখে খুঁজুন। যেমনঃ O Positive রক্তের গ্রুপ খুঁজতে Search Box এ লিখুন - O+.','null',1,'03/12/2021 07:33pm'),(51,'1510233221','Saklayen Ahmed','Database Server Error','19th','We will try to fix the error like \"HTTP 502 Bad Gateway\". Sorry for inconvenience.','null',1,'03/12/2021 07:35pm'),(52,'1510233221','Saklayen Ahmed','সমস্যা জানান','19th','AIS Family Database Browse করতে সমস্যা হলে নিচের WhatsApp নাম্বারে \r\nশুধুমাত্র Message দিন।\r\n\r\nSaklayen : 01727268458\r\nMohaiminul:  01834500857','null',1,'11/12/2021 02:20pm'),(53,'1510233221','Saklayen Ahmed','সর্বশেষ তথ্য হালনাগাদ করুন','19th','আপনার প্রোফাইলে নিয়মিত সর্বশেষ তথ্য হালনাগাদ করুন যাতে অন্যরা আপনার সম্পর্কে সঠিক তথ্য পেতে পারে।','null',1,'18/12/2021 11:15pm'),(54,'1510233221','Saklayen Ahmed','রমজানুল মুবারক - সেহরি ও ইফতারের সময়','19th','রমজানুল মুবারক !!! \r\nআজ ০৩ এপ্রিল ২০২২ - ১ম রমজান \r\nসেহরির শেষ সময়: ৪:২৭ পূর্বাহ্ণ\r\nইফতারের সময়: ৬:১৯ অপরাহ্ন\r\n\r\n ','null',0,'03/04/2022 02:39am');
